import React from 'react'
import { Button, StyleSheet, Text, View } from 'react-native'

const HomeScreen = () => {
    return (
        <View>
            <Text>Yoooooo</Text>
            <Button>Find a Slot</Button>
        </View>
    )
}

export default HomeScreen

const styles = StyleSheet.create({})
